{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/sandragarza77/bellabeat-company-capstone-project?scriptVersionId=106124478\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"# <span style=\"color:#347E5E\"> Bellabeat Capstone Project </span>\nThis project is made as a condition for the completion of the <a href=\"https://www.coursera.org/professional-certificates/google-data-analytics?\">Google Data Analytics Professional Certificate.</a> This 8 course program equips participants with a firm foundation in analytical skills and tools within the data analytics world.\n\n# <span style=\"color:#347E5E\"> Table of Contents </span>\n\n* [1. Introduction](#introduction_1)\n* [2. Business Task](#business_task_2)\n* [3. Data Overview](#data_overview_3)\n    * [3.1 Data Source](#data_source_3_1)\n    * [3.2 Data Privacy and Accessibility](#data_privacy_and_accessibility_3_2)\n    * [3.3 Data Organization](#data_organization_3_3)\n    * [3.4 Data Credibility and Integrity](#data_credibility_and_integrity_3_4)  \n* [4. Process](#process_phase_4)\n    * [4.1 Loading Packages](#loading_packages_4_1)\n    * [4.2 Importing Datasets](#importing_datasets_4_2)\n    * [4.3 Preview our Datasets](#preview_our_datasets_4_3)\n    * [4.4 Cleaning and Formatting](#cleaning_and_formatting_4_4)\n    * [4.5 Merging Datasets](#merging_datasets_4_5)\n* [5. Analyze and Share](#analyze_phase_5)\n    * [5.1 Usage Type Distribution](#usage_type_distribution)\n    * [5.2 Average Steps](#average_steps_by_hour_day)\n    * [5.3 Average Calories](#calories)\n    * [5.4 Average Hourly Intensity](#avg_hour_intensity_usage)\n    * [5.5 Average Distance](#avg_hour_distance_usage)\n    * [5.6 Activity Minutes Comparison](#activity_minutes)\n    * [5.7 Sleep Analysis](#sleep)\n* [6. Recommendations](#recommendations_6)\n***\n\n# <span style=\"color:#347E5E\"> 1. Introduction </span> <a class=\"anchor\" id=\"introduction_1\"></a>\n\nThis case study focuses on the company called Bellabeat. <a href=\"https://bellabeat.com/?\">Bellabeat</a> is a women-driven tech company founded by Urška Sršen and Sando Mur in 2013. The company offers 4 unique products that monitor the participants activity, sleep, stress, menstrual cycle, and mindfulness habits mainly designed by Urška Sršen artistic outlook. \n\n“Leaf” and “Time” are 2 products from Bellabeat that track the participants activity, sleep, and stress. “Leaf” can be worn as a bracelet, necklace, or clip and “Time” is a watch. Now the 3rd product offered by Bellabeat is “Spring,” a water bottle that uses smart technology to track the amount of water the participant is drinking. The 4th product is the Bellabeat app that brings the 3 products listed above all together so that the participant can get a better insight into their habits corresponding to their health. In addition, the customers can obtain the Bellabeat membership which is a subscription that aids the participant with personalized guidance on their health journey based on the customers' goals/lifestyle.\n\n\n***\n\n# <span style=\"color:#347E5E\">  2. Business Task </span>  <a class=\"anchor\" id=\"business_task_2\"></a>\n\nThe stakeholders look forward to having more insight into how consumers of non-Bellabeat smart devices use their devices in their everyday lives based on analyzing the tracked data. We will then use our insights to provide recommendations to the Bellabeat marketing analytics team on one of the Bellabeat products. Within the case study we will take a guide to answering the following questions:\n* What are some trends with the participants using smart devices?\n* How could these trends apply to Bellabeat customers?\n* How could these trends help influence Bellabeat marketing strategy?\n\nIn answering these questions we can accomplish our task of providing insight to the marketing team on a specific Bellabeat product to offer new opportunities to grow. Along with making a bigger impact on people’s health around the globe. The product that we will be focusing on throughout the study is “Leaf.”\n\n***\n\n## <span style=\"color:#347E5E\"> 3. Data Overview </span> <a class=\"anchor\" id=\"data_overview_3\"></a> \n\n#### 3.1 Data Source: <a class=\"anchor\" id=\"data_source_3_1\"></a> \n\nThe source from which our data comes is provided by Mobius on <a href=\"https://www.kaggle.com/arashnic/fitbit?\">Kaggle</a>. I have personally downloaded and stored the files on my computers hard drive. Approximately 30 eligible candidates consented to be part of sharing their data through a survey during the timeframe of 03-12-2016 through 05-12-2016 via Amazon Mechanical Turk. The data includes a minute-level output for physical activity, and heart rate, as well as monitoring sleep. Due to the different types of Fitbit trackers and the preferences of the participant, variation throughout the data is an occurrence.  \n\n#### 3.2 Data Privacy and Accessibility: <a class=\"anchor\" id=\"data_privacy_and_accessibility_3_2\"></a> \n\nThe dataset that has been provided for this case study has been licensed under <a href=\"https://creativecommons.org/publicdomain/zero/1.0/?\">CC0: Public Domain</a>. Therefore, the owner has waived their rights to the work under copyright law. In addition, the work can be copied, modified, distributed, and perform the work, even for commercial purposes, all without asking permission.\n\n#### 3.3 Data Organization:<a class=\"anchor\" id=\"data_organization_3_3\"></a>  \n\nThe dataset includes 18 .CSV files, the files are in long format due to the fact that each participant has a row of data corresponding to each day and time the data was tracked. Therefore, the amount of data corresponding to one participant travels through multiple rows. The files contain information about activity metrics, sleep records, metabolic equivalent of tasks (METs), heart rate, and steps. Due to the fact that some files are subsets of a more complete data frame, not all of the 18 .CSV files will be used for the analysis. \n\n#### 3.4 Data Credibility and Integrity: <a class=\"anchor\" id=\"data_credibility_and_integrity_3_4\"></a> \n\nData credibility is whether the data comes from a good or bad source. The factors of a good data source include the source must be reliable, original, comprehensive, current and cited (ROCCC). This brings me to investigate the limitations that this dataset provides.\n\nThe problem that have been shown throughout the dataset is the fact that there is no metadata provided, such as weather conditions. Another problem that has occurred is that there is no clarity on the demographics of those who participated. In addition, the sample size is smaller than ideal for health/lifestyle data, due to the fact that health habits vary drastically throughout generations and societies. These problems along with the short time frame of the collection of data are all considered limitations and can increase the probability of a sampling bias in the dataset.\n\nData integrity involves how accurate, complete, consistent, and trustful the data is. An example of a dataset that does not have a high level of integrity is when the dataset is dirty, not aligned well to the business objectives, insufficient, and/or contains errors. Some but not all of these issues can be relatively easy to fix. For instance, we can remove duplicates and we can replace nulls with zero values relatively quickly. The integrity of the dataset presented for the case study seems to be fair in the spectrum of integrity. \n\n***\n\n# <span style=\"color:#347E5E\">  4. Process </span> <a class=\"anchor\" id=\"process_phase_4\"></a> \n \nThe data processing that we will be conducted throughout this case study will be done through R programming in R Studio. R programming is a tool that is exceptional when it comes to data exploration, cleaning, analysis and visualization. When it comes to handling a large dataset like the one we have provided for this case study, it is more beneficial to use R programming due to the fact that this programming can handle large amounts of data. \n\n### 4.1 Loading Packages <a class=\"anchor\" id=\"loading_packages_4_1\"></a> \n\nThe following packages will be used in our analysis:\n* tidyverse\n* lubridate\n* skimr\n* janitor\n* ggalluvial\n* ggplot2\n* ggpubr\n* here\n* scales\n* ggrepel\n* RColorBrewer\n* DataExplorer\n* VennDiagram\n* formattable\n* waffle\n* readr\n* tidyr","metadata":{}},{"cell_type":"code","source":"install.packages(\"tidyverse\", dependencies = TRUE)\ninstall.packages(\"lubridate\", dependencies = TRUE)\ninstall.packages(\"janitor\", dependencies = TRUE)\ninstall.packages(\"ggplot2\", dependencies = TRUE)\ninstall.packages(\"skimr\", dependencies = TRUE)\ninstall.packages(\"ggalluvial\", dependencies = TRUE)\ninstall.packages(\"ggpubr\", dependencies = TRUE)\ninstall.packages(\"here\", dependencies = TRUE)\ninstall.packages(\"scales\", dependencies = TRUE)\ninstall.packages(\"ggrepel\", dependencies = TRUE)\ninstall.packages(\"RColorBrewer\", dependencies = TRUE)\ninstall.packages(\"readr\", dependencies = TRUE)\ninstall.packages(\"tidyr\", dependencies = TRUE)\ninstall.packages(\"DataExplorer\", dependencies = TRUE)\ninstall.packages(\"VennDiagram\", dependencies = TRUE)\ninstall.packages(\"formattable\", dependencies = TRUE)\ninstall.packages(\"waffle\", dependencies = TRUE)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:38:34.907911Z","iopub.execute_input":"2022-09-20T14:38:34.910353Z","iopub.status.idle":"2022-09-20T14:44:28.7