urther understand hour by hour analysis of our data. ","metadata":{}},{"cell_type":"code","source":"##hourly_calories\nhourly_calories$activity_hour=as.POSIXct(hourly_calories$activity_hour, format = \"%m/%d/%Y %I:%M:%S %p\",tz = Sys.timezone())\n##hourly_steps\nhourly_steps$activity_hour=as.POSIXct(hourly_steps$activity_hour, format = \"%m/%d/%Y %I:%M:%S %p\",tz = Sys.timezone())\n##hourly_intensities\nhourly_intensities$activity_hour=as.POSIXct(hourly_intensities$activity_hour, format = \"%m/%d/%Y %I:%M:%S %p\",tz = Sys.timezone())\n##sleep_day \nsleep_day$sleep_day=as.POSIXct(sleep_day$sleep_day, format = \"%m/%d/%Y %I:%M:%S %p\",tz = Sys.timezone())\n##daily_activity \ndaily_activity$activity_date=as.POSIXct(daily_activity$activity_date, format = \"%m/%d/%Y\",tz = Sys.timezone())\n###obtaining Day of Week from date\ndaily_activity <- daily_activity %>% \n  mutate(Day = format(ymd(activity_date), format = '%a'))","metadata":{"execution":{"iopub.status.busy":"2022-09-20T14:44:31.658536Z","iopub.execute_input":"2022-09-20T14:44:31.659964Z","iopub.status.idle":"2022-09-20T14:44:31.804109Z"},"trusted":true},"execution_count":10,"outputs":[]},{"cell_type":"markdown","source":"We will now verify that the proper format has occured.","metadata":{}},{"cell_type":"code","source":"class(daily_activity$activity_date)\nclass(hourly_calories$activity_hour)\nclass(hourly_intensities$activity_hour)\nclass(hourly_steps$activity_hour)\nclass(sleep_day$sleep_day)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:31.806528Z","iopub.execute_input":"2022-09-20T14:44:31.808258Z","iopub.status.idle":"2022-09-20T14:44:31.843376Z"},"trusted":true},"execution_count":11,"outputs":[{"output_type":"display_data","data":{"text/html":"<style>\n.list-inline {list-style: none; margin:0; padding: 0}\n.list-inline>li {display: inline-block}\n.list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n</style>\n<ol class=list-inline><li>'POSIX