5ex}\n</style>\n<ol class=list-inline><li>'POSIXct'</li><li>'POSIXt'</li></ol>\n","text/markdown":"1. 'POSIXct'\n2. 'POSIXt'\n\n\n","text/latex":"\\begin{enumerate*}\n\\item 'POSIXct'\n\\item 'POSIXt'\n\\end{enumerate*}\n","text/plain":"[1] \"POSIXct\" \"POSIXt\" "},"metadata":{}}]},{"cell_type":"markdown","source":"### 4.5 Merging Datasets <a class=\"anchor\" id=\"merging_datasets_4_5\"></a>\n\nMerging of all hourly data frames(hourly_steps, hourly_calories, hourly_intensities) using 'id' and 'activity_hour' columns found in all three tables. The hourlies_df table will be the 6th data frame that will be part of our analysis. ","metadata":{}},{"cell_type":"code","source":"#merging hourly dataframes (steps,calories,intensities)----\nhourlies_df <- hourly_steps %>% \n  left_join(hourly_calories, by = c(\"id\", \"activity_hour\")) %>% \n  left_join(hourly_intensities, by = c(\"id\", \"activity_hour\")) %>% \n  separate(activity_hour, sep = \" \", into = c(\"date\",\"time\")) %>% \n  mutate(day = format(ymd(date), format = '%a')) %>% \n  mutate(time = format(parse_date_time(as.character(time), \"HMS\"), format = \"%H:%M\")) %>% \n  mutate(date = as.POSIXct(date))\nhead(hourlies_df,3)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:31.845804Z","iopub.execute_input":"2022-09-20T14:44:31.847414Z","iopub.status.idle":"2022-09-20T14:44:32.871737Z"},"trusted":true},"execution_count":12,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 3 × 8</caption>\n<thead>\n\t<tr><th scope=col>id</th><th scope=col>date</th><th scope=col>time</th><th scope=col>step_total</th><th scope=col>calories</th><th scope=col>total_intensity</th><th scope=col>average_intensity</th><th scope=col>day</th></tr>\n\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dttm&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>1503960366</td><td>2016-04-12</td><td>00:00</td><td>373</td><td>81</td><td>20</td><td>0.333333</td><td>Tue</td></tr>\n\t<tr><td>1503960366</td><td>2016-04-12</td><td>01:00</td><td>160</td><td>61</td><td> 8</td><td>0.133333</td><td>Tue</td></tr>\n\t<tr><td>1503960366</td><td>2016-04-12</td><td>02:00</td><td>151</td><td>59</td><td> 7</td><td>0.116667</td><td>Tue</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 3 × 8\n\n| id &lt;dbl&gt; | date &lt;dttm&gt; | time &lt;chr&gt; | step_total &lt;dbl&gt; | calories &lt;dbl&gt; | total_intensity &lt;dbl&gt; | average_intensity &lt;dbl&gt; | day &lt;chr&gt; |\n|---|---|---|---|---|---|---|---|\n| 1503960366 | 2016-04-12 | 00:00 | 373 | 81 | 20 | 0.333333 | Tue |\n| 1503960366 | 2016-04-12 | 01:00 | 160 | 61 |  8 | 0.133333 | Tue |\n| 1503960366 | 2016-04-12 | 02:00 | 151 | 59 |  7 | 0.116667 | Tue |\n\n","text/latex":"A tibble: 3 × 8\n\\begin{tabular}{llllllll}\n id & date & time & step\\_total & calories & total\\_intensity & average\\_intensity & day\\\\\n <dbl> & <dttm> & <chr> & <dbl> & <dbl> & <dbl> & <dbl> & <chr>\\\\\n\\hline\n\t 1503960366 & 2016-04-12 & 00:00 & 373 & 81 & 20 & 0.333333 & Tue\\\\\n\t 1503960366 & 2016-04-12 & 01:00 & 160 & 61 &  8 & 0.133333 & Tue\\\\\n\t 1503960366 & 2016-04-12 & 02:00 & 151 & 59 &  7 & 0.116667 & Tue\\\\\n\\end{tabular}\n","text/plain":"  id         date       time  step_total calories total_intensity\n1 1503960366 2016-04-12 00:00 373        81       20             \n2 1503960366 2016-04-12 01:00 160        61        8             \n3 1503960366 2016-04-12 02:00 151        59        7             \n  average_intensity day\n1 0.333333          Tue\n2 0.133333          Tue\n3 0.116667          Tue"},"metadata":{}}]},{"cell_type":"markdown","source":"***","metadata":{}},{"cell_type":"markdown","source":"# <span style=\"color:#347E5E\"> 5. Analyze and Share </span> <a class=\"anchor\" id=\"analyze_phase_5\"></a>\n\nWe will analyze trends of the users of FitBit and determine if that can help us on BellaBeat's marketing strategy.\n\n### 5.1 Usage Type Distribution <a class=\"anchor\" id=\"usage_type_distribution\"></a>\nHere we will determine how often the participants use their watches. With `daily_activity`, we will assume that days with < 200 `total_steps` taken, are days where participants have not used their watches. We will filter out these inactive days and assign the following: \n\n* Low Use - 1 to 14 days \n* Moderate Use - 15 to 21 days \n* High Use - 22 to 31 days\n\nBreaking down the analysis in this way will help us further understand the trends underlying each **Usage Groups.**","metadata":{}},{"cell_type":"code","source":"#data transformation to create a dataframe for 'Usage Types' \ndaily_use2 <- daily_activity %>%\n  filter(total_steps >200 ) %>% \n  group_by(id) %>%\n  summarize(activity_date=sum(n())) %>%\n  mutate(Usage = case_when(\n    activity_date >= 1 & activity_date <= 14 ~ \"Low Use\",\n    activity_date >= 15 & activity_date <= 21 ~ \"Moderate Use\", \n    activity_date >= 22 & activity_date <= 31 ~ \"High Use\")) %>% \n  mutate(Usage = factor(Usage, level = c('Low Use','Moderate Use','High Use'))) %>% \n  rename(daysused = activity_date) %>% \n  group_by(Usage)\nhead(daily_use2)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:32.874213Z","iopub.execute_input":"2022-09-20T14:44:32.875649Z","iopub.status.idle":"2022-09-20T14:44:33.011868Z"},"trusted":true},"execution_count":13,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A grouped_df: 6 × 3</caption>\n<thead>\n\t<tr><th scope=col>id</th><th scope=col>daysused</th><th scope=col>Usage</th></tr>\n\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;fct&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>1503960366</td><td>30</td><td>High Use    </td></tr>\n\t<tr><