dgAAAAAQRLADAAAAgCCCHQAAAAAEEewA\nAAAAIIhgBwAAAABBBDsAAAAACCLYAQAAAEAQwQ4AAAAAggh2AAAAABBEsAMAAACAIIIdAAAA\nAAQR7AAAAAAgiGAHAAAAAEEEOwAAAAAIItgBAAAAQBDBDgAAAACCCHYAAAAAEESwAwAAAIAg\ngh0AAAAABBHsAAAAACCIYAcAAAAAQQQ7AAAAAAgi2AEAAABAEMEOAAAAAIIIdgAAAAAQRLAD\nAAAAgCCCHQAAAAAEEewAAAAAIIhgBwAAAABBBDsAAAAACCLYAQAAAEAQwQ4AAAAAggh2AAAA\nABBEsAMAAACAIIIdAAAAAAQR7AAAAAAgiGAHAAAAAEEEOwAAAAAIItgBAAAAQBDBDgAAAACC\nCHYAAAAAEESwAwAAAIAggh0AAAAABBHsAAAAACCIYAcAAAAAQQQ7AAAAAAgi2AEAAABAEMEO\nAAAAAIIIdgAAAAAQRLADAAAAgCCCHQAAAAAEEewAAAAAIIhgBwAAAABBBDsAAAAACCLYAQAA\nAEAQwQ4AAAAAggh2AAAAABBEsAMAAACAIIIdAAAAAAQR7AAAAAAgiGAHAAAAAEEEOwAAAAAI\nItgBAAAAQBDBDgAAAACCCHYAAAAAEESwAwAAAIAggh0AAAAABBHsAAAAACCIYAcAAAAAQQQ7\nAAAAAAgi2AEAAABAEMEOAAAAAIIIdgAAAAAQRLADAAAAgCCCHQAAAAAEEewAAAAAIIhgBwAA\nAABBBDsAAAAACCLYAQAAAEAQwQ4AAAAAggh2AAAAABBEsAMAAACAIIIdAAAAAAQR7AAAAAAg\niGAHAAAAAEEEOwAAAAAIItgBAAAAQBDBDgAAAACCCHYAAAAAEESwAwAAAIAggh0AAAAABBHs\nAAAAACCIYAcAAAAAQQQ7AAAAAAgi2AEAAABAEMEOAAAAAIIIdgAAAAAQRLADAAAAgCCCHQAA\nAAAEEewAAAAAIIhgBwAAAABBBDsAAAAACCLYAQAAAEAQwQ4AAAAAggh2AAAAABBEsAMAAACA\nIIIdAAAAAAQR7AAAAAAgiGAHAAAAAEEEOwAAAAAIItgBAAAAQBDBDgAAAACCCHYAAAAAEESw\nAwAAAIAggh0AAAAABBHsAAAAACCIYAcAAAAAQQQ7AAAAAAgi2AEAAABAEMEOAAAAAIIIdgAA\nAAAQRLADAAAAgCCCHQAAAAAEEewAAAAAIIhgBwAAAABBBDsAAAAACCLYAQAAAEAQwQ4AAAAA\nggh2AAAAABBEsAMAAACAIIIdAAAAAAQR7AAAAAAgiGAHAAAAAEEEOwAAAAAIItgBAAAAQBDB\nDgAAAACCCHYAAAAAEESwAwAAAIAggh0AAAAABBHsAAAAACCIYAcAAAAAQQQ7AAAAAAjyHzwF\nV07EBrKuAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"width":840,"height":600}}}]},{"cell_type":"markdown","source":"This waffle chart was made to portray the 'Usage Type Distibution' in a unique visual manner. Each square represents 1 participant. ","metadata":{}},{"cell_type":"markdown","source":"**Observations:**\n\n- **73%** of participants who frequently used their devices between 22-31 days. This makes up 24 out of 33 participants.\n\n- **12%** of participants who moderately used their devices between 15-21 days. This makes up 7 out of 33 participants. \n\n- **6%** of participants who used their devices least frequently between 1-14 days. This makes up 2 out of 33 participants.\n\nA large majority of participants use the device within the frequent category. I believe that the participants have an understanding that in order to receive the full impact of their activity habits, they must wear the device often.\n\n***","metadata":{}},{"cell_type":"markdown","source":"### 5.2 Average Steps <a class=\"anchor\" id=\"average_steps_by_hour_day\"></a>\nHere, we will take into account the steps taken by participants within the groups. While 10,000 daily steps have often been established as the recommended target, recent [studies](https://www.bbc.com/future/article/20190723-10000-steps-a-day-the-right-amount) suggest that 5500 - 7500 steps would be an achievable target, depending on the participants' health and age range.\n\n * [5.2.1 Average Steps by Day](#steps_1)\n * [5.2.2 Average Steps by Usage](#steps_2)","metadata":{}},{"cell_type":"markdown","source":"#### 5.2.1 Average Steps By Day<a class=\"anchor\" id=\"steps_1\"></a>","metadata":{}},{"cell_type":"code","source":"#data manipulation to add Usage Types to 'daily_activity' dataframe\ndaily_activity_usage <- daily_activity %>% \n  left_join(daily_use2, by = 'id') %>% \n  mutate(day = format(ymd(activity_date), format = '%a')) %>% \n  mutate(total_minutes_worn = sedentary_minutes+lightly_active_minutes+\n           fairly_active_minutes+very_active_minutes) %>% \n  mutate(total_hours = seconds_to_period(total_minutes_worn * 60))\nhead(daily_activity_usage,6)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:34.112446Z","iopub.execute_input":"2022-09-20T14:44:34.11377Z","iopub.status.idle":"2022-09-20T14:44:34.172853Z"},"trusted":true},"execution_count":18,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 21</caption>\n<thead>\n\t<tr><th scope=col>id</th><th scope=co