h Use | 13162 | Tue |\n| High Use | 10735 | Wed |\n| High Use | 10460 | Thu |\n| High Use |  9762 | Fri |\n| High Use | 12669 | Sat |\n| High Use |  9705 | Sun |\n\n","text/latex":"A grouped\\_df: 6 × 3\n\\begin{tabular}{lll}\n Usage & total\\_steps & day\\\\\n <fct> & <dbl> & <fct>\\\\\n\\hline\n\t High Use & 13162 & Tue\\\\\n\t High Use & 10735 & Wed\\\\\n\t High Use & 10460 & Thu\\\\\n\t High Use &  9762 & Fri\\\\\n\t High Use & 12669 & Sat\\\\\n\t High Use &  9705 & Sun\\\\\n\\end{tabular}\n","text/plain":"  Usage    total_steps day\n1 High Use 13162       Tue\n2 High Use 10735       Wed\n3 High Use 10460       Thu\n4 High Use  9762       Fri\n5 High Use 12669       Sat\n6 High Use  9705       Sun"},"metadata":{}}]},{"cell_type":"code","source":"#boxplot for distance\nstepsbp %>%\n  ggplot(aes(x= , y= total_steps, fill= Usage)) +\n    geom_boxplot() +\n    scale_y_continuous(limits=c(0,40000), breaks=seq(0,40000, by = 5000))+\n    theme(legend.position=\"none\",\n      plot.title = element_text(size=11)    ) +\n    ggtitle(\"A boxplot with jitter\") +\n    xlab(\"\") +\n    labs(title= (\"Average Steps\"), subtitle = ('By Usage Group'), x=\" \" , y=\"Calories\")+\ntheme(plot.title=element_text(size = 16,hjust = 0))+\n    theme(plot.subtitle=element_text(size = 14,hjust = 0))+\n    theme(axis.text.y=element_text(size=14)) +\n    theme(axis.text.x=element_text(size=14,hjust= 0.5))+\n    theme(axis.title.x = element_text(margin = margin(t = 14, r = 0, b = 0, l = 0)))+\n    theme(axis.title.y = element_text(margin = margin(t = 0, r = 10, b = 0, l = 0)))+\n    theme(axis.text.x=element_blank(),axis.ticks.x=element_blank())+\n    theme(legend.position = \"top\")+\n    theme(legend.title=element_text(size=12))+\n    theme(legend.text=element_text(size=8))+\nfacet_grid(~Usage)\noptions(repr.plot.width = 5, repr.plot.height = 6)","metadata":{"_kg_hide-output":false,"execution":{"iopub.status.busy":"2022-09-20T14:45:36.688268Z","iopub.execute_input":"2022-09-20T14:45:36.6