ourly Intensity <a class=\"anchor\" id=\"avg_hour_intensity_usage\"></a>\n\n\n* [5.4.1 Intensity By Day](#intensity_1)\n* [5.4.2 Intensity By Day, Groups](#intensity_3)\n* [5.4.3 Intensity By Day, Groups, Time](#intensity_4)","metadata":{}},{"cell_type":"markdown","source":"#### 5.4.1 Intensity By Day<a class=\"anchor\" id=\"intensity_1\"></a>","metadata":{}},{"cell_type":"code","source":"#data for steps \nintensity1 <- hourlies_df %>% \n    filter(total_intensity > 0) %>%\n  group_by(day) %>%   \n  summarise(mean_intensity = round(mean(total_intensity)),\n            std_mean_intensity = round(sd(total_intensity))) %>%\n mutate(day = factor(day, level = c('Mon', 'Tue', 'Wed','Thu', 'Fri', 'Sat', 'Sun')))\nhead(intensity1)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:36.271879Z","iopub.execute_input":"2022-09-20T14:44:36.273599Z","iopub.status.idle":"2022-09-20T14:44:36.331246Z"},"trusted":true},"execution_count":27,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 3</caption>\n<thead>\n\t<tr><th scope=col>day</th><th scope=col>mean_intensity</th><th scope=col>std_mean_intensity</th></tr>\n\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>Fri</td><td>20</td><td>23</td></tr>\n\t<tr><td>Mon</td><td>21</td><td>26</td></tr>\n\t<tr><td>Sat</td><td>22</td><td>25</td></tr>\n\t<tr><td>Sun</td><td>21</td><td>25</td></tr>\n\t<tr><td>Thu</td><td>20</td><td>23</td></tr>\n\t<tr><td>Tue</td><td>20</td><td>24</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 6 × 3\n\n| day &lt;fct&gt; | mean_intensity &lt;dbl&gt; | std_mean_intensity &lt;dbl&gt; |\n|---|---|---|\n| Fri | 20 | 23 |\n| Mon | 21 | 26 |\n| Sat | 22 | 25 |\n| Sun | 21 | 25 |\n| Thu | 20 | 23 |\n| Tue | 20 | 24 |\n\n","text/latex":"A tibble: 6 × 3\n\\begin{tabular}{lll}\n day & mean\\_intensity & std\\_mean\\_intensity\\\\\