y', \n       caption = \"\")+\n      theme(plot.title=element_text(size = 14,hjust = 0.5))+\n      theme(axis.text.y=element_text(size=9)) +\n      theme(axis.text.x=element_text(size=8, angle = 0,hjust= 0.5))+\n      theme(axis.title.x = element_text(margin = margin(t = 10, r = 0, b = 0, l = 0)))+\n      theme(axis.title.y = element_text(margin = margin(t = 0, r = 10, b = 0, l = 0)))+\n      theme(legend.title=element_text(size=10))+\n      theme(legend.text=element_text(size=8)) +\n  guides(fill = guide_colourbar(barwidth = 0.45,barheight = 8))+\n  facet_wrap (~Usage, ncol = 1 ),\n    \n    ##step avg intensity\n ggplot(intensityhr, aes(x=time, y=intensity, fill = intensity))+ \n  scale_fill_gradient(low = \"green\", high = \"red\")+\n  geom_bar(stat = 'identity', show.legend = TRUE) +\n  coord_flip() +\n  ggtitle(\"Intensity By Hours\", \"All user groups\") +\n  xlab(\"Intensity\") + ylab(\"Hour\") +\n  theme(axis.text.x = element_text(size=9, angle = 0), \n        axis.text.y = element_text(size=7))+\n  theme(legend.position = \"right\")+\n  guides(fill = guide_colourbar(barwidth = 0.45,barheight = 8))+\n  facet_grid(Usage~day), ncol = 1)\noptions(repr.plot.width = 12, repr.plot.height = 16)","metadata":{"_kg_hide-output":false,"execution":{"iopub.status.busy":"2022-09-20T14:46:03.904795Z","iopub.execute_input":"2022-09-20T14:46:03.906409Z","iopub.status.idle":"2022-09-20T14:46:06.211928Z"},"trusted":true},"execution_count":58,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABLAAAAPACAIAAACqxhfXAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wUZfoA8Gdmdna21/QOSSCEEEIJvSMIgggW7J6e5fTseqen5ym2s5+eFcup\np+fv5OwdQRGl95aEFEgCKaRvb1N/f+xms0k2IWWToHm+n/yRnfa877vvvDvvlHcISZIAIYQQ\nQgghhNDwQw51AhBCCCGEEEIIDQ3sECKEEEIIIYTQMIUdQoQQQgghhBAaprBDiBBCCCGEEELD\nFHYIEUIIIYQQQmiYwg4hQgghhBBCCA1T2CFECCGEEEIIoWEKO4QIIYQQQgghNExhhxAhhBBC\nCCGEhinsECKE0CDZdOUogiAIgkhb/uVQp2WISYLNXxT/qnd3tcxZRiVBECsONQ5mwgCg6vvF\nBEGkLv2hn9v5fn5SRLYzVMr+PYcgiKxrtg11QhB