ity in the evenings. \n\n- 'High Use' participants tend to maintain a high average of hourly intensity throughout the week.\n\n- Compared to other groups, the 'High Use' participants have higher intensities between 6:00 AM - 7:00AM. We can assume that participants from this group have the habit to start their day with exercise.\n\n- 'High Use' participants are taking significantly more steps after office hours between 5:00 PM - 8:00 PM. \n\n***","metadata":{}},{"cell_type":"markdown","source":"### 5.5 Average Distance <a class=\"anchor\" id=\"avg_hour_distance_usage\"></a>\n\n * [5.5.1 Distance travelled by Groups](#distance1)\n * [5.5.2 Distance travelled by Day, Groups](#distance2)","metadata":{}},{"cell_type":"code","source":"#data for distance \ndistancebp <- daily_activity_usage %>% \ngroup_by(day,Usage) %>%\nselect(day, Usage, total_distance) %>%\n    mutate(day = factor(day, level = c('Mon', 'Tue', 'Wed','Thu', 'Fri', 'Sat', 'Sun')))\nhead(distancebp) ","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:40.566833Z","iopub.execute_input":"2022-09-20T14:44:40.568293Z","iopub.status.idle":"2022-09-20T14:44:40.611537Z"},"trusted":true},"execution_count":33,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A grouped_df: 6 × 3</caption>\n<thead>\n\t<tr><th scope=col>day</th><th scope=col>Usage</th><th scope=col>total_distance</th></tr>\n\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>Tue</td><td>High Use</td><td>8.50</td></tr>\n\t<tr><td>Wed</td><td>High Use</td><td>6.97</td></tr>\n\t<tr><td>Thu</td><td>High Use</td><td>6.74</td></tr>\n\t<tr><td>Fri</td><td>High Use</td><td>6.28</td></tr>\n\t<tr><td>Sat</td><td>High Use</td><td>8.16</td></tr>\n\t<tr><td>Sun</td><td>High Use</td><td>6.48</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA grouped_df: 6 × 3\n\n| day &lt;fct&gt; | Usage &lt;fct&gt; |