ext/latex":"A grouped\\_df: 6 × 3\n\\begin{tabular}{lll}\n day & Usage & total\\_distance\\\\\n <fct> & <fct> & <dbl>\\\\\n\\hline\n\t Tue & High Use & 8.50\\\\\n\t Wed & High Use & 6.97\\\\\n\t Thu & High Use & 6.74\\\\\n\t Fri & High Use & 6.28\\\\\n\t Sat & High Use & 8.16\\\\\n\t Sun & High Use & 6.48\\\\\n\\end{tabular}\n","text/plain":"  day Usage    total_distance\n1 Tue High Use 8.50          \n2 Wed High Use 6.97          \n3 Thu High Use 6.74          \n4 Fri High Use 6.28          \n5 Sat High Use 8.16          \n6 Sun High Use 6.48          "},"metadata":{}}]},{"cell_type":"code","source":"#boxplot for distance\n  ggplot(distancebp, aes(x= day, y= total_distance, fill= Usage)) +\n    geom_boxplot() +\n    scale_y_continuous(limits=c(0,30), breaks=seq(0,30, by = 2))+\n    theme(legend.position=\"none\",\n      plot.title = element_text(size=11)    ) +\n    ggtitle(\"A boxplot with jitter\") +\n    xlab(\"\") +\n    labs(title= (\"Average Distance\"), subtitle = ('By Usage Group'), x=\"Day\" , y=\"Distance\")+\ntheme(plot.title=element_text(size = 16,hjust = 0))+\n    theme(plot.subtitle=element_text(size = 14,hjust = 0))+\n    theme(axis.text.y=element_text(size=14)) +\n    theme(axis.text.x=element_text(size=14,hjust= 0.5))+\n    theme(axis.title.x = element_text(margin = margin(t = 14, r = 0, b = 0, l = 0)))+\n    theme(axis.title.y = element_text(margin = margin(t = 0, r = 10, b = 0, l = 0)))+\n    theme(legend.position = \"top\")+\n    theme(legend.title=element_text(size=12))+\n    theme(legend.text=element_text(size=8))+\nfacet_grid(~Usage)\noptions(repr.plot.width = 12, repr.plot.height = 8)","metadata":{"_kg_hide-output":false,"execution":{"iopub.status.busy":"2022-09-20T14:46:18.629772Z","iopub.execute_input":"2022-09-20T14:46:18.631755Z","iopub.status.idle":"2022-09-20T14:46:19.80958Z"},"trusted":true},"execution_count":59,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAeACAIAAAC38WeAAAAABmJLR0QA/wD/AP