is dataset designates every non-sleeping minute of the day into four different intensities - Sedentary Minutes, Lightly Active Minutes, Fairly Active Minutes, and Very Active Minutes. \n\nThese states of activity are based on their MET ratings. One MET is the energy you spend sitting at rest. Therefore, an activity with a MET value of 4 means you’re exerting four times the energy than if you were sitting still. For instance, a brisk walk at 3 to 4 miles per hour has about 4 METs. Jumping rope, which is a more intense activity, has a MET value of 12.3\n\n* Sedentary Minutes - < 1.5 METs\n* Lightly Active Minutes - Between 1.5 - 3 METs\n* Fairly Active Minutes - Between 3 - 6 METs\n* Very Active Minutes - > 6 METs ","metadata":{}},{"cell_type":"code","source":"#data transformation to obtain total_minutes_worn\ndaily_activity_usage <- daily_activity %>% \n  left_join(daily_use2, by = 'id','activity_date') %>% \n  mutate(day = format(ymd(activity_date), format = '%a')) %>% \n  mutate(total_minutes_worn = sedentary_minutes+lightly_active_minutes+\n           fairly_active_minutes+very_active_minutes) %>% \n  mutate(total_hours = seconds_to_period(total_minutes_worn * 60))\nhead(daily_activity_usage,3)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:42.116926Z","iopub.execute_input":"2022-09-20T14:44:42.119277Z","iopub.status.idle":"2022-09-20T14:44:42.183972Z"},"trusted":true},"execution_count":37,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 3 × 21</caption>\n<thead>\n\t<tr><th scope=col>id</th><th scope=col>activity_date</th><th scope=col>total_steps</th><th scope=col>total_distance</th><th scope=col>tracker_distance</th><th scope=col>logged_activities_distance</th><th scope=col>very_active_distance</th><th scope=col>moderately_active_distance</th><th scope=col>light_active_distance</th><th scope=col>sedentary_active_distance</th><th scope=col>⋯</th><th scope=col>fair