se & Wed & 1033 & 17H 13M 0S\\\\\n\t 1503960366 & 2016-04-14 & 10460 & 6.74 & 6.74 & 0 & 2.44 & 0.40 & 3.91 & 0 & ⋯ & 11 & 181 & 1218 & 1776 & Thu & 30 & High Use & Thu & 1440 & 1d 0H 0M 0S\\\\\n\\end{tabular}\n","text/plain":"  id         activity_date total_steps total_distance tracker_distance\n1 1503960366 2016-04-12    13162       8.50           8.50            \n2 1503960366 2016-04-13    10735       6.97           6.97            \n3 1503960366 2016-04-14    10460       6.74           6.74            \n  logged_activities_distance very_active_distance moderately_active_distance\n1 0                          1.88                 0.55                      \n2 0                          1.57                 0.69                      \n3 0                          2.44                 0.40                      \n  light_active_distance sedentary_active_distance ⋯ fairly_active_minutes\n1 6.06                  0                         ⋯ 13                   \n2 4.71                  0                         ⋯ 19                   \n3 3.91                  0                         ⋯ 11                   \n  lightly_active_minutes sedentary_minutes calories Day daysused Usage    day\n1 328                     728              1985     Tue 30       High Use Tue\n2 217                     776              1797     Wed 30       High Use Wed\n3 181                    1218              1776     Thu 30       High Use Thu\n  total_minutes_worn total_hours\n1 1094               18H 14M 0S \n2 1033               17H 13M 0S \n3 1440               1d 0H 0M 0S"},"metadata":{}}]},{"cell_type":"markdown","source":"#### 5.6.1 Daily Activity Minutes <a class=\"anchor\" id=\"all_minutes\"></a>\nHere, the `daily_activity_usage` is further manipulated to obtain how the four states of activity differ across 'Usage Groups'.","metadata":{}},{"cell_type":"code","source":"#data transformation to set up df for various piecharts\n##overall activity minutes piechart\ndailytypemins <- daily_activity %>% \n  select(\"Day\",\"sedentary_minutes\",\"lightly_active_minutes\",\"fairly_active_minutes\",\"very_active_minutes\") %>% \n  pivot_longer(cols =2:5, names_to=\"Category\",values_to='Minutes') %>% \n  group_by(Category) %>% \n  summarise(Minutes = round(mean(Minutes))) %>% \n  mutate(perc = Minutes/sum(Minutes)) %>% \n  arrange(perc) %>% \n  mutate(perc = scales::percent(perc)) %>% \n  mutate(Category = factor(Category,level = c('sedentary_minutes','active_minutes','lightly_active_minutes', \n  'fairly_active_minutes','very_active_minutes')))\nhead(dailytypemins,3)\n\n###high usage activity minutes piechart\ndailytypeminshigh <- daily_activity_usage %>% \n  filter(Usage == 'High Use') %>% \n  select(\"Day\",\"sedentary_minutes\",\"lightly_active_minutes\",\"fairly_active_minutes\",\"very_active_minutes\") %>% \n  pivot_longer(cols =2:5, names_to=\"Category\",values_to='Minutes') %>% \n  group_by(Category) %>% \n  summarise(Minutes = round(mean(Minutes))) %>% \n  mutate(perc = Minutes/sum(Minutes)) %>% \n  arrange(perc) %>% \n  mutate(perc = scales::percent(perc)) %>% \n  mutate(Category = factor(Category,level = c('sedentary_minutes','active_minutes','lightly_active_minutes', \n                                              'fairly_active_minutes','very_active_minutes')))\nhead(dailytypeminshigh,3)\n\n###moderate usage activity minutes piechart\ndailytypeminsmod <- daily_activity_usage %>% \n  filter(Usage == 'Moderate Use') %>% \n  select(\"Day\",\"sedentary_minutes\",\"lightly_active_minutes\",\"fairly_active_minutes\",\"very_active_minutes\") %>% \n  pivot_longer(cols =2:5, names_to=\"Category\",values_to='Minutes') %>% \n  group_by(Category) %>% \n  summarise(Minutes = round(mean(Minutes))) %>% \n  mutate(perc = Minutes/sum(Minutes)) %>% \n  arrange(perc) %>% \n  mutate(perc = scales::percent(perc)) %>% \n  mutate(Category = factor(Category,level = c('sedentary_minutes','active_minutes','lightly_active_minutes', \n                                              'fairly_active_minutes','very_active_minutes')))\nhead(dailytypeminsmod,3)\n\n###low usage activity minutes piechart\ndailytypeminslow <- daily_activity_usage %>% \n  filter(Usage == 'Low Use') %>% \n  select(\"Day\",\"sedentary_minutes\",\"lightly_active_minutes\",\"fairly_active_minutes\",\"very_active_minutes\") %>% \n  pivot_longer(cols =2:5, names_to=\"Category\",values_to='Minutes') %>% \n  group_by(Category) %>% \n  summarise(Minutes = round(mean(Minutes))) %>% \n  mutate(perc = Minutes/sum(Minutes)) %>% \n  arrange(perc) %>% \n  mutate(perc = scales::percent(perc)) %>% \n  mutate(Category = factor(Category,level = c('sedentary_minutes','active_minutes','lightly_active_minutes', \n                                              'fairly_active_minutes','very_active_minutes'))) \n\nhead(dailytypeminslow,3)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:42.187278Z","iopub.execute_input":"2022-09-20T14:44:42.188971Z","iopub.status.idle":"2022-09-20T14:44:42.454328Z"},"trusted":true},"execution_count":38,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 3 × 3</caption>\n<thead>\n\t<tr><th scope=col>Category</th><th scope=col>Minutes</th><th scope=col>perc</th></tr>\n\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>fairly_active_minutes </td><td> 14</td><td>1.15% </td></tr>\n\t<tr><td>very_active_minutes   </td><td> 21</td><td>1.72% </td></tr>\n\t<tr><td>lightly_active_minutes</td><td>193</td><td>15.83%</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 3 × 3\n\n| Category &lt;fct&gt; | Minutes &lt;dbl&gt; | perc &lt;chr&gt; |\n|---|---|---|\n| fairly_active_minutes  |  14 | 1.15%  |\n| very_active_minutes    |  21 | 1.72%  |\n| lightly_active_minutes | 193 | 15.83% |\n\n","text/latex":"A tibble: 3 × 3\n\\begin{tabular}{lll}\n Category & Minutes & perc\\\\\n <fct> 