DeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AA\nAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AA\nAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AA\nAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AA\nAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AA\nAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AA\nAAAAAADeY+AAAAAAAADeY+AAAAAAAADeY+AAAAAAAADe+z9sL7kqp+CwPwAAAABJRU5ErkJg\ngg=="},"metadata":{"image/png":{"width":720,"height":480}}}]},{"cell_type":"markdown","source":"**Observations:**\n\n- 'High Use' participants have the most minutes across all of the groups: 'Lightly Active', 'Fairly Active', and 'Very Active'. In addition, they spend 78.7% being sedentary. \n- Unsurprisingly, the 'Low Use' participants spend 93.2% of their day being sedentary. ","metadata":{}},{"cell_type":"markdown","source":"#### 5.6.2 Comparison of Light and Active Minutes <a class=\"anchor\" id=\"la_minutes\"></a>","metadata":{}},{"cell_type":"code","source":"#data for moderately_active & very_active minutes\nactive_minutes <- daily_activity_usage %>% \n  group_by(Usage) %>% \n  summarise(very_active = mean(very_active_minutes),\n            fairly_active = mean(fairly_active_minutes)) %>% \n  mutate(Usage = factor(Usage, level = c('High Use', 'Moderate Use', 'Low Use'))) %>% \n  pivot_longer(cols =2:3, names_to=\"Category\",values_to='Minutes') \nhead(active_minutes)\n\n##data for sedentary & lightly_active minutes\nlight_minutes <- daily_activity_usage %>% \n  group_by(Usage) %>% \n  summarise(lightly_active = mean(lightly_active_minutes)/60,\n            sedentary = mean(sedentary_minutes)/60) %>% \n  mutate(Usage = factor(Usage, level = c('High Use', 'Moderate Use', 'Low Use'))) %>% \n  pivot_longer(cols =2:3, names_to=\"Category\",values_to='Hours')\nhead(light_minutes)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:43.895884Z","iopub.exe