ly_active  3.571409\n6 High Use     sedentary      15.671455"},"metadata":{}}]},{"cell_type":"code","source":"#comparison of sedentary minutes & lightly active minutes\nggarrange(\n  ggplot(light_minutes, aes(fill=Category, y= Hours, x=Usage)) + \n    geom_bar(position=\"stack\", stat=\"identity\")+\n    scale_fill_manual(values = c(\"#00BFC4\",\"#C77CFF\"))+\n    theme(axis.text.x = element_text(size = 11, angle = 0, hjust = 0.5, vjust = 1))+\n    theme(legend.position = \"top\")+\n    labs(x=\"\" , y=\"Hours\")+\n    ggtitle(\"Comparison of Average Light Minutes\", \"By Usage Groups, Activity Levels\"),\n  \n  ggplot(active_minutes, aes(fill=Category, y= Minutes, x=Usage)) + \n  geom_bar(position=\"stack\", stat=\"identity\")+\n  scale_fill_manual(values = c('#F8766D',\"#7CAE00\"))+\n  theme(axis.text.x = element_text(size = 11, angle = 0, hjust = 0.5, vjust = 1))+\n  theme(legend.position = \"top\")+\n  labs(x=\"\" , y=\"Minutes\")+\n  ggtitle(\"Comparison of Average Active Minutes\", \"By Usage Groups, Activity Levels\"), ncol = 2\n) \noptions(repr.plot.width = 14, repr.plot.height = 10)","metadata":{"execution":{"iopub.status.busy":"2022-09-20T14:44:43.987862Z","iopub.execute_input":"2022-09-20T14:44:43.989189Z","iopub.status.idle":"2022-09-20T14:44:44.685652Z"},"trusted":true},"execution_count":41,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2AUVReA4TNbk+ymBwiE0ELvRXqVJh0siIoiCCgCIh2UXgRUBAFFUEDFxocN\nlWKh2QAVUFGa9N5DGum78/3YsCxJSDY9E97nFztz586Zeyc7h7Ozs4qqqgIAAAAAAKBluoIO\nAAAAAAAAIKcocAAAAAAAAM2jwAEAAAAAADSPAgcAAAAAANA8ChwAAAAAAEDzKHAAAAAAAADN\no8ABAAAAAAA0jwIHAAAAAADQPE0WOFRb9LqlM3t3bBIaHORpNPkGFK/X4r6JCz68mmQv6NBy\n054X6iqK0vnH8wUdSNbEXtw2oF2DIKupRI0X3Wmv2m9U9jIpiqLTm3bHJOV1eIXKjQtvKori\n4dsi42bZOBOOvN9KUZRW7x/JWYAiIuGH+yqKoihKQJU5d2xkj69qMTmabYtMcCzT6AkMAE7k\nG4UZ+Ub25NE45M9ZRE4CIFPaK3DcOLf1vooh9w+b9tkPv12JlRIhJZS48L9+/f7lMU9UqNxx\nx7X4gg7wbjet5QPvbd1rr