w Use' participants. ","metadata":{}},{"cell_type":"markdown","source":"#### 5.6.3 Fairly Active & Very Active Minutes by Day, Usage Group  <a class=\"anchor\" id=\"fava_minutes\"></a>","metadata":{}},{"cell_type":"code","source":"#data for fairly_active & very_active minutes\nactive_minutes2 <- daily_activity_usage %>% \n  group_by(day, Usage) %>%   \n  summarise(fairly_active = mean(fairly_active_minutes),\n            very_active = mean(very_active_minutes)) %>%  \n  pivot_longer(cols =3:4, names_to=\"Category\",values_to='Minutes') %>% \n  mutate(day = factor(day, level = c('Mon', 'Tue', 'Wed','Thu', 'Fri', 'Sat', 'Sun'))) \nhead(active_minutes2)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:44.687865Z","iopub.execute_input":"2022-09-20T14:44:44.689171Z","iopub.status.idle":"2022-09-20T14:44:44.760383Z"},"trusted":true},"execution_count":42,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'day'. You can override using the `.groups`\nargument.\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A grouped_df: 6 × 4</caption>\n<thead>\n\t<tr><th scope=col>day</th><th scope=col>Usage</th><th scope=col>Category</th><th scope=col>Minutes</th></tr>\n\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>Fri</td><td>Low Use     </td><td>fairly_active</td><td> 4.80000</td></tr>\n\t<tr><td>Fri</td><td>Low Use     </td><td>very_active  </td><td> 7.80000</td></tr>\n\t<tr><td>Fri</td><td>Moderate Use</td><td>fairly_active</td><td> 5.36000</td></tr>\n\t<tr><td>Fri</td><td>Moderate Use</td><td>very_active  </td><td> 1.80000</td></tr>\n\t<tr><td>Fri</td><td>High Use    </td><td>fairly_active</td><td>14.25000</td></tr>\n\t<tr><td>Fri</td><td>High Use    </td><td>very_active  </td><td>25.44792</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA grouped_df: 6 × 4\n\n| day &lt;fct&gt; | Usage &lt;fct&gt; | Category &lt;chr&gt; | Minutes &lt;dbl&gt; |\n|---|---|---|---|\n| Fri | Low Use      | fairly_active |  4.80000 |\n| Fri | Low Use      | very_active   |  7.80000 |\n| Fri | Moderate Use | fairly_active |  5.36000 |\n| Fri | Moderate Use | very_active   |  1.80000 |\n| Fri | High Use     | fairly_active | 14.25000 |\n| Fri | High Use     | very_active   | 25.44792 |\n\n","text/latex":"A grouped\\_df: 6 × 4\n\\begin{tabular}{llll}\n day & Usage & Category & Minutes\\\\\n <fct> & <fct> & <chr> & <dbl>\\\\\n\\hline\n\t Fri & Low Use      & fairly\\_active &  4.80000\\\\\n\t Fri & Low Use      & very\\_active   &  7.80000\\\\\n\t Fri & Moderate Use & fairly\\_active &  5.36000\\\\\n\t Fri & Moderate Use & very\\_active   &  1.80000\\\\\n\t Fri & High Use     & fairly\\_active & 14.25000\\\\\n\t Fri & High Use     & very\\_active   & 25.44792\\\\\n\\end{tabular}\n","text/plain":"  day Usage        Category      Minutes \n1 Fri Low Use      fairly_active  4.80000\n2 Fri Low Use      very_active    7.80000\n3 Fri Moderate Use fairly_active  5.36000\n4 Fri Moderate Use very_active    1.80000\n5 Fri High Use     fairly_active 14.25000\n6 Fri High Use     very_active   25.44792"},"metadata":{}}]},{"cell_type":"code","source":"#comparison of active minutes between usage types\nggplot(active_minutes2,aes(day,Minutes, fill = Usage))+ \n  geom_col()+\n  theme(axis.text.x = element_text(size = 11, angle = 60, hjust = 1, vjust = 1))+\n  theme(legend.position = \"top\")+\n  labs(x=\"Days\" , y=\"Hours\")+\n  ggtitle(\"Comparison of Lightly Active Mins\", \"By Groups, Days and Levels\") +\n  facet_grid(Category ~ Usage)","metadata":{"execution":{"iopub.status.busy":"2022-09-20T14:44:44.762589Z","iopub.execute_input":"2022-09-20T14:44:44.763899Z","iopub.status.idle":"2022-09-20T14:44:45.476672Z"},"trusted":true},"execution_count":43,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAA