ve minutes\nlightly_active <- daily_activity_usage %>% \n  group_by(day, Usage) %>%   \n  summarise(lightly_active = mean(lightly_active_minutes)/60) %>% \n  pivot_longer(cols =3, names_to=\"Category\",values_to='Minutes') %>% \n  mutate(day = factor(day, level = c('Mon', 'Tue', 'Wed','Thu', 'Fri', 'Sat', 'Sun')))\nhead(lightly_active,3)\n\n#data for sedentary minutes\nsedentary <- daily_activity_usage %>% \n  group_by(day, Usage) %>%   \n  summarise(sedentary = mean(sedentary_minutes)/60) %>% \n  pivot_longer(cols =3, names_to=\"Category\",values_to='Minutes') %>% \n  mutate(day = factor(day, level = c('Mon', 'Tue', 'Wed','Thu', 'Fri', 'Sat', 'Sun'))) \nhead(sedentary,3)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:45.478841Z","iopub.execute_input":"2022-09-20T14:44:45.480127Z","iopub.status.idle":"2022-09-20T14:44:45.620919Z"},"trusted":true},"execution_count":44,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'day'. You can override using the `.groups`\nargument.\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A grouped_df: 3 × 4</caption>\n<thead>\n\t<tr><th scope=col>day</th><th scope=col>Usage</th><th scope=col>Category</th><th scope=col>Minutes</th></tr>\n\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>Fri</td><td>Low Use     </td><td>lightly_active</td><td>1.173333</td></tr>\n\t<tr><td>Fri</td><td>Moderate Use</td><td>lightly_active</td><td>2.310667</td></tr>\n\t<tr><td>Fri</td><td>High Use    </td><td>lightly_active</td><td>3.803993</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA grouped_df: 3 × 4\n\n| day &lt;fct&gt; | Usage &lt;fct&gt; | Category &lt;chr&gt; | Minutes &lt;dbl&gt; |\n|---|---|---|---|\n| Fri | Low Use      | lightly_active | 1.173333 |\n| Fri | Moderate Use | lightly_acti