p) %>% \n  drop_na() %>% \n  mutate(sleep_quality = ifelse(total_minutes_asleep <= 360, 'Below Recommended',\n                         ifelse(total_minutes_asleep <= 420,  'Fairly Recommended',\n                         ifelse(total_minutes_asleep <= 540, 'Recommended', 'Above Recommended')))) %>% \n  mutate(sleep_quality = factor(sleep_quality,level = c('Below Recommended', 'Fairly Recommended',\n                                    'Recommended','Above Recommended')))\nhead(sleepday2)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:46.714751Z","iopub.execute_input":"2022-09-20T14:44:46.716097Z","iopub.status.idle":"2022-09-20T14:44:46.765852Z"},"trusted":true},"execution_count":46,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 2</caption>\n<thead>\n\t<tr><th scope=col>total_minutes_asleep</th><th scope=col>sleep_quality</th></tr>\n\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;fct&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>327</td><td>Below Recommended </td></tr>\n\t<tr><td>384</td><td>Fairly Recommended</td></tr>\n\t<tr><td>412</td><td>Fairly Recommended</td></tr>\n\t<tr><td>340</td><td>Below Recommended </td></tr>\n\t<tr><td>700</td><td>Above Recommended </td></tr>\n\t<tr><td>304</td><td>Below Recommended </td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 6 × 2\n\n| total_minutes_asleep &lt;dbl&gt; | sleep_quality &lt;fct&gt; |\n|---|---|\n| 327 | Below Recommended  |\n| 384 | Fairly Recommended |\n| 412 | Fairly Recommended |\n| 340 | Below Recommended  |\n| 700 | Above Recommended  |\n| 304 | Below Recommended  |\n\n","text/latex":"A tibble: 6 × 2\n\\begin{tabular}{ll}\n total\\_minutes\\_asleep & sleep\\_quality\\\\\n <dbl> & <fct>\\\\\n\\hline\n\t 327 & Below Recommended \\\\\n\t 384 & Fairly Recommended\\\\\n\t 412 & Fairly Recommended\\\\\n\t 340 & Below Recommended \\\\\n\t 700 & Above Recommended \\\\\n\t 304 & Below Recommended \\