yvLLCLNht7UD1Q+uXqvrkF6nYhsXVrGsydzL/5wyWy5dTnuAZXpJQDY\nWf1+oSJiyvjjx3M55bVRFNO61DwRcQvuJCJRv14QkXr3Tx31UJuS1Q0RKcjiMVh3tWqkuyS6\nccCe/h/0Np38Z5jPrQAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":720,"height":480}}}]},{"cell_type":"markdown","source":"**Observations:**\n\n- Thursdays have the lowest amount of sleep, while Sundays have the highest.\n- With no surprise, due to having rest days, the range of sleep is also the widest on the weekends.\n- Wednesday has the highest average sleep during the weekdays.","metadata":{}},{"cell_type":"markdown","source":"#### 5.7.3 Average Sleep Hours by Day, Group <a class=\"anchor\" id=\"sleep3\"></a>","metadata":{}},{"cell_type":"code","source":"#data prep\nsleep_dayusage <- sleep_day %>% \n  left_join(daily_use2, by = 'id') %>%\n  mutate(day = format(ymd(sleep_day), format = '%a')) %>% \n  group_by(day, Usage) %>% \n  summarise(avg_hrs_asleep = round(mean(total_minutes_asleep)/60,2),\n            avg_hrs_in_bed = round(mean(total_time_in_bed)/60,2),\n            std_hrs_asleep = round((sd(total_minutes_asleep/60)),2),\n            std_hrs_in_bed = round((sd(total_time_in_bed/60)),2)) %>% \n  mutate(day = factor(day, level = c('Mon', 'Tue', 'Wed','Thu', 'Fri', 'Sat', 'Sun')))\nhead(sleep_dayusage)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-09-20T14:44:47.970619Z","iopub.execute_input":"2022-09-20T14:44:47.97254Z","iopub.status.idle":"2022-09-20T14:44:48.063692Z"},"trusted":true},"execution_count":51,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22m`summarise()` has grouped output by 'day'. You can override using the `.groups`\nargument.\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A grouped_df: 6 × 6</caption>\n<thead>\n\t<tr><th scope=col>day</th><th scope=col>Usage</th><th scope=col>avg_hrs_asleep</th><th scope=col>avg_hrs_in_bed</th><th scope=col>std_hrs_asleep</th><th scope=col>std_hrs_in_bed</th></tr>\n\t<tr><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>Fri</td><td>Low Use     </td><td>6.42</td><td>6.80</td><td>  NA</td><td>  NA</td></tr>\n\t<tr><td>Fri</td><td>Moderate Use</td><td>7.28</td><td>8.32</td><td>1.41</td><td>2.98</td></tr>\n\t<tr><td>Fri</td><td>High Use    </td><td>6.66</td><td>7.26</td><td>1.98</td><td>2.12</td></tr>\n\t<tr><td>Mon</td><td>Moderate Use</td><td>7.49</td><td>8.06</td><td>0.75</td><td>1.13</td></tr>\n\t<tr><td>Mon</td><td>High Use    </td><td>6.96</td><td>7.59</td><td>2.06</td><td>2.23</td></tr>\n\t<tr><td>Sat</td><td>Low Use     </td><td>1.28</td><td>1.28</td><td>  NA</td><td>  NA</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA grouped_df: 6 × 6\n\n| day &lt;fct&gt; | Usage &lt;fct&gt; | avg_hrs_asleep &lt;dbl&gt; | avg_hrs_in_bed &lt;dbl&gt; | std_hrs_asleep &lt;dbl&gt; | std_hrs_in_bed &lt;dbl&gt; |\n|---|---|---|---|---|---|\n| Fri | Low Use      | 6.42 | 6.80 |   NA |   NA |\n| Fri | Moderate Use | 7.28 | 8.32 | 1.41 | 2.98 |\n| Fri | High Use     | 6.66 | 7.26 | 1.98 | 2.12 |\n| Mon | Moderate Use | 7.49 | 8.06 | 0.75 | 1.13 |\n| Mon | High Use     | 6.96 | 7.59 | 2.06 | 2.23 |\n| Sat | Low Use      | 1.28 | 1.28 |   NA |   NA |\n\n","text/latex":"A grouped\\_df: 6 × 6\n\\begin{tabular}{llllll}\n day & Usage & avg\\_hrs\\_asleep & avg\\_hrs\\_in\\_bed & std\\_hrs\\_asleep & std\\_hrs\\_in\\_bed\\\\\n <fct> & <fct> & <dbl> & <dbl> & <dbl> & <dbl>\\\\\n\\hline\n\t Fri & Low Use      & 6.42 & 6.80 &   NA &   NA\\\\\n\t Fri & Moderate Use & 7.28 & 8.32 & 1.41 & 2.98\\\\\n\t Fri & High Use     & 6.66 & 7.26 & 1.98 & 2.12\\\\\n\t Mon & Moderate Use & 7.49 & 8.06 & 0.75 & 1.13\\\\\n\t Mon & High Use     & 6.96 & 7.59 & 2.06 & 2.23\\\\\n\t Sat & Low Use      & 1.28 & 1.28 &   NA &   NA\\\\\n\\end{tabular}\n","text/plain":"  day Usage        avg_hrs_asleep avg_hrs_in_bed std_hrs_asleep std_hrs_in_bed\n1 Fri Low Use      6.42           6.80             NA             NA          \n2 Fri Moderate Use 7.28           8.32           1.41           2.98          \n3 Fri High Use     6.66           7.26           1.98           2.12          \n4 Mon Moderate Use 7.49           8.06           0.75           1.13          \n5 Mon High Use     6.96           7.59           2.06           2.23          \n6 Sat Low Use      1.28           1.28             NA             NA          "},"metadata":{}}]},{"cell_type":"code","source":"ggplot(sleep_dayusage, aes(x = day, y= avg_hrs_asleep, fill = avg_hrs_asleep)) +\n    geom_col(color=\"darkblue\", size = 0.2) +\n    geom_errorbar(mapping=aes(ymin = avg_hrs_asleep - 0.5 * (std_hrs_asleep), \n                            ymax = avg_hrs_asleep + 0.5 * (std_hrs_asleep), \n                            width = 0.5)) +\n    geom_text(aes(label = avg_hrs_asleep, y =0.4), position = position_dodge(0.9), size = 4.5, angle = 0,  color = \"black\", hjust = 0.5)+\n    scale_fill_gradientn(limits=c(0,9), breaks=seq(0,9, by = 2), colours = brewer.pal(5, \"Purples\")) + \n    scale_y_continuous(limits=c(0,9), breaks=seq(0,9, by = 1))+\n    labs(title= (\"Average Hours Asleep\"), subtitle = ('By Group, Days'), x='Day', y='Hours')+\n    theme(plot.title=element_text(size = 16,hjust = 0))+\n    theme(plot.subtitle=element_text(size = 14,hjust = 0))+\n    theme(axis.text.y=element_text(size=9)) +\n    theme(axis.text.x=element_text(size=14,hjust= 0.5))+\n    theme(axis.title.x = element_text(margin = margin(t = 14, r = 0, b = 0, l = 0)))+\n    theme(axis.title.y = element_text(margin = margin(t = 0, r = 10, b = 0, l = 0)))+\n    theme(legend.position = \"top\")+\n    theme(legend.title=element_text(size=6))+\n    theme(legend.text=element_text(size=8)) +\n    facet_grid(~Usage)\noptions(repr.plot.width = 14, repr.plot.height = 10)","metadata":{"_kg_hide-output":false,"execution":{"iopub.status.busy":"2022-09-20T14:47:3