f3nrQAAAFD9pUTcHdx6aaM7J41pFSAiIvaM89Gbfv/1SGJe8xFv\nH1o83aSI2M39awetz/KfNP25Lg28o45s/+bL38Lq2rbF6P8zd/bD94300Ski8nxj/w+iMz0D\nbslJ+4srwAAAAFWLgh0AAMD1orBgV3yJl29Qk7Y9Rj/89CsP36a/uDAn5q/JE1/5c9fhLI86\nnbv0eva9//bI+6Zr/xnxBT5RKedCjHoRify6T8uJWzq8vGv/Ozc4vR0AAABujoIdAAAAKm33\n9I7dZh5cdj73zpqero4FAADA3VCwAwAAQOXYC5J71gw5Fjgl4+yHro4FAADADfGUWAAAAFTC\nE1OfzT2xdGeW5eGlz7g6FgAAAPfEHXYAAACohDa1fU9b/UdO+Wj+GyNdHQsAAIB7omAHAAAA\nAAAAaIjO1QEAAAAAAAAAuISCHQAAAAAAAKAhFOwAAAAAAAAADaFgBwAAAAAAAGgIBTsAAAAA\nAABAQyjYAQAAAAAAABpCwQ4AAAAAAADQEAp2AAAAAAAAgIZQsAMAAAAAAAA05P8B6goRMdfH\ngcEAAAAASUVORK5CYII="},"metadata":{"image/png":{"width":840,"height":600}}}]},{"cell_type":"markdown","source":"**Observations:**\n\n- The 'High Use' group has relatively lower average hours of sleep. This group also has a more consistent pattern in comparison to the other groups.  \n- The 'Moderate Use' group has the highest average hours of sleep. This group has a more inconsistent pattern throughout the week, pointing to the range of sleep patterns amongst its participants. \n-  The 'Low Use' group only has a sample size of 1 and will not be considered for this analysis. \n\n***","metadata":{}},{"cell_type":"markdown","source":"# <span style=\"color:#347E5E\"> 6. Recommendations </span> <a class=\"anchor\" id=\"recommendations_6\"></a>","metadata":{}},{"cell_type":"markdown","source":"The task of the business is to seek the trends from the dataset to further advance its marketing strategy for a Bellabeat product. The trends of the Fitbit Dataset show that all 33 participants use the step count function. 24 participants used the sleep tracking function. In addition, 14 participants used the heart-rate tracking function. 8 participants used their devices to track their weight journey. We omitted the use of the functions in our analysis, except for the step count function data, due to the irregular use of the functions.\n\nWithin the 'High Use' group, participants were the most active with a larger range of exercises, had the highest amount of calories burned, showed dedication to their daily routine, and had a sufficient amount of sleep. Within the 'Moderate Use' group, they as well showed dedication to their daily routine and 10.7% of their daily minutes were invested in being active. Within the 'Low Use' group, the participants showed the lowest average of steps and calories burnt. In addition, the trends of the 'Low Use' group are skewed due to not having any recognizable patterns and having only 2 participants within the group.\n\nSome recommendations for the product \"Leaf\" are:\n* Account for users’ unwillingness to monitor their sleep. You all can further promote the countless uses of Leaf wellness-tracker that can be clipped on a piece of clothing while the user is sleeping.\n* Encourage women no-matter the differences in their activity levels to stay informed about their health. Whether they are active or less active, Leaf’s smart technology can help with every woman’s wellness goals and mindful habits.\n* Highlight Leaf’s combination of fashion and function. Leaf can be worn in three different ways, and has five color options. Women can track daily activity while still being stylish all day.\n\nMarketing strategies resulting from this analysis are limited because of the lack of user demographic data (age, occupation, etc.). For instance, Bellabeat can target its advertising based on age, the location of the target audience, and market the product based on the target consumers' purchasing power.\n\nFor future analysis/marketing strategies, Bellabeat might want to consider the following things.\n* Gather more recent activity data (on the number of users and time range), preferably large enough to increase the accuracy and reliability of the analysis.\n* Ensure that the activity data is collected only from female users.\n* Take account of demographic data, such as age, weight, location, and occupation.\n\n***","metadata":{}},{"cell_type":"markdown","source":"# <span style=\"color:#347E5E\"> Special Thanks </span> <a class=\"anchor\" ></a>\nThank you for taking the time to read my case study, I have learned a greater amount about the case study process as well as R programming by doing this.","metadata":{}}]}